-- Create table ads_data -> Contains info about rental ads
CREATE TABLE ads_data (
	"Property type" varchar(9),
	Size varchar(8),
	Rooms numeric(3,1),
	Floor varchar(12),
	Furnished varchar(3),
	Shareable varchar(3),
	"Pets allowed" varchar(13),
	Elevator varchar(13),
	"Senior friendly" varchar(13),
	"Students only" varchar(13),
	Balcony varchar(13),
	Parking varchar(13),
	Dishwasher varchar(13),
	"Washing machine" varchar(13),
	"Electric charging station" varchar(13),
	Dryer varchar(13),
	"Energy rating" varchar(1),
	"Rental period" varchar(12),
	"Available from" varchar(19),
	"Monthly net rent" varchar(13),
	Utilities varchar(12),
	Deposit varchar(13),
	"Prepaid rent" varchar(13),
	"Move-in price" varchar(13),
	"Creation Date" timestamp,
	"Listing-id" integer,
	Adress varchar(71)
);

-- Create table amager_sides
CREATE TABLE amager_sides (
	"Amager adress" varchar(23),
	"Amager side" varchar(20)
);

-- Create table bydel
CREATE TABLE bydel (
	navn varchar(25),
	areal_m2 integer,
	wkb_geometry varchar(71745)
);

